import {Link} from 'react-router-dom'

const Header =(props)=>{
    return(
        <Fragment>
        {props.stt ? <Link to="/search"> SEARCH </Link> : <Link exact to="/"> HOME </Link>}
            {/* <Link to="/search"> SEARCH </Link> */}
            {/* <Link exact to="/"> HOME </Link> */}
        </Fragment>

    )
}
export default Header
